import Link from "next/link";

const Navbar = () => {
  const styles = {
    display: "flex",
    background: "grey",
    alignItems: "space-between",
    justifyContent: "center"
  };
  return (
    <div style={styles}>
      <Link href="/about">
        <a>About</a>
      </Link>
      <br></br>
      <Link href="/contact">
        <a>Contact</a>
      </Link>
    </div>
  );
};
export default Navbar;
